import * as cheerio from 'cheerio'




const App = () => {

    const [items, setItems] = useState([]);

    const fetchItems = async () => {
        let response = await fetch("https://www.amazon.com/s?k=gaming/", {
            method: "GET",
            headers: {
                "Content-Type": "application/html"
            }
        });
        let body = await response.text();
        console.log(body);
    }

    useEffect(
        () => {
            fetchItems();
        }, []
    )

    return (
        <div>App</div>
    )
}

export default App
